## getImsOrgMe

<a id="opIdgetImsOrgMe"></a>

`GET /1.0/users/ims/orgs/me`

*Returns the imsOrg associated with the provided IMS User token*

<h3 id="getimsorgme-parameters">Parameters</h3>

|Name|In|Type|Required|Description|
|---|---|---|---|---|
|x-gw-ims-org-id|header|string|false|the imsOrgId header|
|expansion|query|array[string]|false|Comma-delimited list of additional metadata fields to include on response.|

#### Enumerated Values

|Parameter|Value|
|---|---|
|expansion|name|
|expansion|datacenter|
|expansion|modified|
|expansion|createDate|
|expansion|eccId|
|expansion|contractIds|
|expansion|fulfillableItems|
|expansion|fulfillableItems.dataTransferLimit|
|expansion|fulfillableItems.dataRestatementLimit|
|expansion|fulfillableItems.profileCount|
|expansion|fulfillableItems.profileTransferLimit|
|expansion|fulfillableItems.profileRestatementLimit|
|expansion|fulfillableItems.concurrentRequests|
|expansion|fulfillableItems.apiCallsPerMinute|
|expansion|fulfillableItems.attributions|
|expansion|fulfillableItems.dataRows|
|expansion|companyId|
|expansion|uppFulfillableItems|
|expansion|productId|
|expansion|ident|

> Example responses

> 200 Response

```json
{
  "type": "object",
  "required": [
    "imsOrgId"
  ],
  "properties": {
    "createDate": {
      "type": "string",
      "format": "date-time",
      "description": "This cannot be edited by clients"
    },
    "contractIds": {
      "type": "array",
      "description": "Contract IDs",
      "items": {
        "type": "string"
      }
    },
    "eccId": {
      "type": "integer",
      "format": "int32",
      "description": "EccId. This cannot be edited"
    },
    "modified": {
      "type": "string",
      "format": "date-time",
      "description": "This cannot be edited by clients"
    },
    "imsOrgId": {
      "type": "string",
      "description": "an ims org id"
    },
    "name": {
      "type": "string",
      "description": "Name pulled from ims. This cannot be edited"
    },
    "datacenter": {
      "type": "string",
      "description": "Datacenter pulled from UPP. This cannot be edited"
    },
    "fulfillableItems": {
      "description": "Fulfillable Items. UPP Provisioning data merged together",
      "type": "object",
      "properties": {
        "dataTransferLimit": {
          "type": "integer",
          "format": "int32",
          "description": "This is based off DX_CJA_DATA_TRANSFER from UPP"
        },
        "dataRestatementLimit": {
          "type": "integer",
          "format": "int32",
          "description": "This is based off DX_CJA_DATA_RESTATEMENT from UPP"
        },
        "profileCount": {
          "type": "integer",
          "format": "int32",
          "description": "This is based off DX_CJA_PROFILES from UPP (Profile transfer limit) in the UPP UI"
        },
        "profileTransferLimit": {
          "type": "integer",
          "format": "int32",
          "description": "This is based off DX_CJA_PROFILE_SIZE from UPP (Profile Size(KB per profile)) or (300 KB per profile) in the UPP UI"
        },
        "profileRestatementLimit": {
          "type": "integer",
          "format": "int32",
          "description": "This is based off DX_CJA_PROFILES_RESTATEMENT from UPP"
        },
        "concurrentRequests": {
          "type": "integer",
          "format": "int32",
          "description": "This is based off DX_CJA_CONCURRENT_REQUESTS from UPP (CJA Concurrent Requests) in the UPP UI"
        },
        "apiCallsPerMinute": {
          "type": "integer",
          "format": "int32",
          "description": "This is based off DX_CJA_API_CALLS from UPP (CJA Api Calls (Calls_Minute_USER)) in the UPP UI"
        },
        "profileTransferLimitQuantity": {
          "type": "integer",
          "format": "int32",
          "description": "This is based off DX_CJA_PROFILE_SIZE_QUANTITY from UPP (1_UNIT) in the UPP UI"
        },
        "profileTransferTotalSize": {
          "type": "integer",
          "format": "int32",
          "description": "This is calculated by adding up the product of every profileTransferLimitQuantity and profileTransferLimit pair from every current offer purchased"
        },
        "attributions": {
          "type": "boolean",
          "description": "A boolean that can be set to T/F"
        },
        "dataRows": {
          "type": "integer",
          "format": "int32",
          "description": "This is based off DX_CJA_DATA_ROWS from UPP"
        }
      }
    },
    "uppFulfillableItems": {
      "type": "array",
      "description": "Current UPP fulfillment data",
      "items": {
        "type": "object",
        "properties": {
          "id": {
            "type": "string"
          },
          "licenseId": {
            "type": "string"
          },
          "code": {
            "type": "string"
          },
          "unit": {
            "type": "string"
          },
          "cap": {
            "type": "integer",
            "format": "int32"
          },
          "rows": {
            "type": "integer",
            "format": "int32"
          },
          "fulfillmentId": {
            "type": "string"
          },
          "contractId": {
            "type": "string"
          },
          "attributions": {
            "type": "boolean"
          }
        }
      }
    },
    "productId": {
      "type": "string",
      "description": "IMS CJA Product Id"
    },
    "companyId": {
      "type": "integer",
      "format": "int32",
      "description": "CJA mapped analytics companyId"
    },
    "ident": {
      "type": "string",
      "description": "IMS CJA ident"
    },
    "microserviceMigrationComplete": {
      "type": "boolean",
      "description": "Microservice Migration Complete"
    }
  }
}
```

