|»» dataRestatementLimit|integer(int32)|false|none|This is based off DX_CJA_DATA_RESTATEMENT from UPP|
|»» profileCount|integer(int32)|false|none|This is based off DX_CJA_PROFILES from UPP (Profile transfer limit) in the UPP UI|
|»» profileTransferLimit|integer(int32)|false|none|This is based off DX_CJA_PROFILE_SIZE from UPP (Profile Size(KB per profile)) or (300 KB per profile) in the UPP UI|
