|»» apiCallsPerMinute|integer(int32)|false|none|This is based off DX_CJA_API_CALLS from UPP (CJA Api Calls (Calls_Minute_USER)) in the UPP UI|
|»» profileTransferLimitQuantity|integer(int32)|false|none|This is based off DX_CJA_PROFILE_SIZE_QUANTITY from UPP (1_UNIT) in the UPP UI|
|»» profileTransferTotalSize|integer(int32)|false|none|This is calculated by adding up the product of every profileTransferLimitQuantity and profileTransferLimit pair from every current offer purchased|
|»» attributions|boolean|false|none|A boolean that can be set to T/F|
|»» dataRows|integer(int32)|false|none|This is based off DX_CJA_DATA_ROWS from UPP|
