## calculatedmetrics_updateCalculatedMetric

<a id="opIdcalculatedmetrics_updateCalculatedMetric"></a>

`PUT /1.0/users/calculatedmetrics/{id}`

*Update an existing calculated metric*

The following fields can be modified through this endpoint: <br><b>name, description, definition, owner, rsid</b>
Example "defintion" for use in testing API below ("Visits per visitor"):<br>
"definition": {
      "formula": {
        "func": "divide",
        "col1": {
          "func": "metric",
          "name": "metrics/visits",
          "description": "Visits"
        },
        "col2": {
          "func": "metric",
          "name": "metrics/visitors",
          "description": "Unique Visitors"
        }
      },
      "func": "calc-metric",
      "version": [
        1,
        0,
        0
      ]
