## upsertDeleteDimensionsBulk

<a id="opIdupsertDeleteDimensionsBulk"></a>

`PUT /1.0/users/data/{dataviewId}/dimensions/bulk`

*Performs bulk create, update and delete operations of dimensions for a dataview. Updates are partial updates, meaning not all attributes are required to be passed in on an update request. For dimensions that need to be deleted, the isDeleted property must be set to true*

Used to upsert dimensions for a dataview in bulk

