## findAll_1

<a id="opIdfindAll_1"></a>

`GET /1.0/users/segments`

*Retrieves paginated segments*

A segment response will always include these default items:<br><b>id</b><br><br>Other attributes can be optionally requested through the 'expansion' field: <br><b>name</b>: Name of the segment<br><b>description</b>: Description of the segment<br><b>dataId</b>: Associated Data ID of the segment<br><b>owner</b>: Owner of the segment<br><b>modified</b>: Date that the segment was last modified (ISO 8601)<br><b>definition</b>: Segment definition as JSON object<br><b>compatibility</b>: Products that the segment is compatible with<br><b>isDeleted</b>: Returns whether or not the segment is 'Deleted' (note that deleted segments are only returned if requested by ID)

<h3 id="findall_1-parameters">Parameters</h3>

|Name|In|Type|Required|Description|
|---|---|---|---|---|
|expansion|query|array[string]|false|Comma-delimited list of additional segment metadata fields to include on response.|
|includeType|query|array[string]|false|Include additional segments not owned by user.|
|dataIds|query|string|false|Filter list to only include segments tied to the specified data group ID list (comma-delimited)|
|ownerId|query|string|false|Filter list to only include segments owned by the specified imsUserId|
|filterByIds|query|string|false|Filter list to only include segments in the specified list (comma-delimited list of IDs). This has filtered Ids from tags, approved, favorites and user specified Ids list.|
