|locale|query|string|false|Locale|
|name|query|string|false|Filter list to only include segments that contains the Name|
|filterByModifiedAfter|query|string|false|Filter list to only include segments modified since this date (ISO8601 format)|
|cached|query|boolean|false|return cached results|
|pagination|query|string|false|Return paginated results|
|limit|query|integer|false|Number of results per page|
|page|query|integer|false|Page number (base 0 - first page is "0")|
|sortDirection|query|int|false|Sort direction (ASC or DESC|
